import React from "react";

function Members() {
  const members = [
    {
      id: 1,
      name: "John",
      status: true,
    },
    {
      id: 2,
      name: "Paul",
      status: false,
    },
    {
      id: 3,
      name: "Bob",
      status: false,
    },
    {
      id: 4,
      name: "Alice",
      status: true,
    },
  ];
  return (
    <div>
          <div>Members</div>
          <ul>
              {
                  members.map(member => (
                      <li>{member.name}</li>
                  ))
              }
          </ul>
    </div>
  );
}

export default Members;
